{%- raw -%}
{%- set names = {} -%}
<p>{{results}}</p>
{%- for row in results -%}
  {%- set tc = row["tool_content"].splitlines() -%}
  {%- for line in tc -%}
      {%- set line = line.strip() -%}
        {%- if "prompt_template_name" in line -%}
          {%- set name = line.split()[1].replace('"', '').replace(',','').strip() -%}
          {%- if name not in names -%}
            {%- set _ = names.update({name: 1}) -%}
          {%- else -%}
            {%- set _ = names.update({name: names[name] + 1 }) -%}
          {%- endif -%}
        {%- endif -%}

  {%- endfor -%}

{%- endfor -%}

{%- set data = [] -%}
{%- for n in names -%}
    {%- set _ = data.append({"name": n, "count": names[n]}) -%}
{%- endfor -%}

<div style='overflow: flex; width: 100%; height: 100%;'>
<table style='border-collapse: collapse; width: 100%; height: 100%;'>
{%- for n in data | sort(attribute='count', reverse=True)  -%}
  <tr style='border-bottom: 1px solid #ccc;'><td><b>{{n["name"]}}</b></td><td>{{n["count"]}}</td></tr>
{%- endfor -%}
</table>
</div>
{%- endraw -%}

